import {
  Route,
  Redirect,
  RouteProps,
  RouteComponentProps,
} from "react-router-dom";

interface IPrivateRoute {
  component: any;
  rest: { path: string; component: React.FC<{}> };
}

export const PrivateRoute1 = ({ component: Component, ...rest }: any) => {
  return (
    <Route
      {...rest}
      render={(props: any) =>
        localStorage.getItem("token") ? (
          <Component {...props} />
        ) : (
          <Redirect to="/" />
        )
      }
    />
  );
};
export const PrivateRoute: React.FC<RouteProps> = ({
  component: Component,
  ...rest
}: {
  component: React.ComponentType<RouteComponentProps<any>>;
}) => (
  <Route
    {...rest}
    render={(props) =>
      localStorage.getItem("token") ? (
        <Component {...props} />
      ) : (
        <Redirect to="/" />
      )
    }
  />
);
